import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import {NavMenu} from "./Navigation"

function App() {
  return (
    <Router>
     <NavMenu/>
     <Switch>
          <Route exact path="/">
            <h1>home</h1>
          </Route>
          <Route path="/github">
            <h1>github</h1>
          </Route>
        </Switch>
    </Router>
  );
}

export default App;
